import React from "react";
import Pokemon from "./Pokemon.js";

const Card = ({ trainer }) => {
  return (
    <div className="card">
      <p>{trainer.name}</p>
      <button>Add Pokemon</button>
      <ul>
        {trainer.pokemons.map(pokemon => {
          return <Pokemon pokemon={pokemon} key={pokemon.id} />;
        })}
      </ul>
    </div>
  );
};

export default Card;
